import React, { Component } from 'react';
import Root from './containers/Root';

class CalendarContainer extends Component {
  render() {
    return (
      <div className="calendar-container">
        <div>
         <Root />
        </div>
      </div>
    );
  }
}

export default CalendarContainer;
